Medicare covers cytogenetic tests when they are reasonable and necessary for the diagnosis or treatment of the following conditions:
    - Genetic disorders (e.g., mongolism) in a fetus;
    - Failure of sexual development;
   -  Chronic myelogenous leukemia;
    - Acute leukemias lymphoid (FAB L1-L3), myeloid (FAB M0-M7), and unclassified; or
    - Myelodysplasia.

