1) Covered physician/practitioner services, including doctor's office visits, include:
    - Medically-necessary medical care or surgery services furnished in a physicians office, certified ambulatory surgical center, hospital outpatient department, or any other location;
    - Consultation, diagnosis, and treatment by a specialist;
    - Basic hearing and balance exams performed by your PCP or specialist, if your doctor orders it to see if you need medical treatment;
    - Certain telehealth services including consultation, diagnosis, and treatment by a physician or practitioner for patients in certain rural areas or other locations approved by Medicare;
    - Second opinion by another network provider prior to surgery; and
    - Non-routine dental care (covered services are limited to surgery of the jaw or related structures, setting fractures of the jaw or facial bones, extraction of teeth to prepare the jaw for radiation treatments of neoplastic cancer disease, or services that would be covered when provided by a physician).

